import React from 'react';
import { Link } from 'react-router-dom';

function Navbar({ toggleHover }) {
  return (
    <div>
      <Link to="/">Home</Link>
      <Link to="/about">About</Link>
      <button onClick={handleToggleHover}>
        {toggleHover ? 'Unhover All' : 'Hover All'}
      </button>
    </div>
  );
}

export default Navbar;
